import React, { useState, useEffect } from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Row from 'react-bootstrap/Row';

import HeaderNav from './HeaderNav';
import "./UserPage.css";

function UserPage(props) {
    let cardList;
    let lists;

    let collectionList;
    const [collections, setCollections] = useState(null);
    const [cards, setOfficialCards] = useState(null);
    const [viewCardsModal, setViewCardsModal] = useState(false);
    const {loggedUser} = props;

    const [viewMode, setViewMode] = useState(3);


    useEffect(() => {
        fetch(`/collections/user/${props.loggedUser.id}`)
        .then((res) => res.json())
        .then((col) =>{
            setCollections(col)
        }
            )
        .catch(
            (error) => { })

        fetch(`/cards/${props.loggedUser.id}`)
            .then((res) => res.json())
            .then((cards) =>{
                setOfficialCards(cards)
            }
                    )
            .catch((error) => { })

    }, [props.loggedUser.id]);

    const handleViewMode =(value)=>{
        setViewMode(value);
    }

    const handleViewCardsModal = ()=>{
        setViewCardsModal(!viewCardsModal);
    }

    const headerProps = {
        handleViewMode,
        loggedUser
    }

    let getCardCol = (cardId)=>{
        if(collections){
            let cardName = collections.find((col)=>col.id == cardId)

            return cardName ? cardName.colName : "None";
        }
        return "None";
    }

    //Fill in variable with list of cards to display
    if(cards){
        cardList = cards.map((cardGroup)=> cardGroup.map((card, index)=>{
            return(
              <Card className = "card" key= {index} bg= 'Info' text = 'dark' style={{ width: '18rem' }}>
                 <Card.Header as="h5">
                    <Card.Title>{card.cardName}</Card.Title>
                    <Card.Subtitle className="subtitle">Collection: {getCardCol(card.collectionId)}</Card.Subtitle>
                </Card.Header>
                 <Card.Body>
                     <Card.Text>
                     {card.description}
                     </Card.Text>
                 </Card.Body>
                 <Card.Footer>
                    <ButtonGroup aria-label="First group">
                        <Button  size = "sm" variant="secondary">Edit</Button>
                        <Button  size = "sm" variant="secondary">Delete</Button>
                    </ButtonGroup>
                 </Card.Footer>
             </Card>
             )
         }))
    }


    //Fill in variable with list of collections to display
    if(collections){
        collectionList = collections.map((collection, index)=>{
            return(
              <Card className = "card"  key= {index} bg= 'Info' text = 'dark' style={{ width: '18rem' }}>
                <Card.Header as="h5">
                </Card.Header>
                 <Card.Img vaiant="top" src="../logo.svg" />
                 <Card.Body>
                     <Card.Title>{collection.colName}</Card.Title>
                 </Card.Body>
                 <Card.Footer>
                    <ButtonGroup aria-label="First group" >
                            <Button size = "sm" variant="light">Edit</Button>
                            <Button size = "sm" variant="outline-info" onClick={handleViewCardsModal}>View Cards</Button>
                            <Button size = "sm" variant="outline-secondary">Delete</Button>
                        </ButtonGroup>
                 </Card.Footer>
             </Card>
             )
         })
    }

    //Conditional Rendering according with view mode

    switch(viewMode){
        case 1:
            lists = <div> <p>Your Cards</p>

            <Row xs={2} md={3} className="justify-content-center"> {cardList}</Row></div>
            break;
        case 2:
            lists = <div> <p>Your Collections</p>
            <Row xs={2} md={3} className="justify-content-center"> {collectionList}</Row></div>
            break;
        case 3:
        default:
            lists = <div> 
                <p>Your Cards</p>
                <Row xs={2} md={3} className="justify-content-center"> {cardList}</Row>

                <p>Your Collections</p>
                <Row xs={2} md={3} className="justify-content-center"> {collectionList}</Row>
            </div>
    }
    
    return (
        <div className='userPage'>
            <div className='header'>
                <HeaderNav {...headerProps} style={{ width: '100%' }}></HeaderNav>
            </div>
            <div className='body'>
                {lists}

            </div>
           

        </div>
    );
}

export default UserPage;
